export interface  GalaGoogleViewWindow {
    [points: string] : {
        min: number;
        max: number;
    };
}
export const gataCartViewWindow: GalaGoogleViewWindow = {
    60: {min: 25, max: 90},
    100: {min: 30, max: 150},
    150: {min: 50, max: 230},
    200: {min: 75, max: 300},
    300: {min: 100, max: 450},
    600: {min: 200, max: 1000},
}

export interface  GalaGoogleData {
    [points: string] : any[][];
}
export let galaGoogleData: GalaGoogleData = {}
Object.entries(galaData).forEach(([points, series]) => {
    galaGoogleData[points] = []
    galaGoogleData[points].push(['CSG'])
    series.forEach((serie, i) => {
        if (serie.with_b_stone) {
            galaGoogleData[points][0].push(serie.name + ' (B)')
        } else {
            galaGoogleData[points][0].push(serie.name)
        }
    })
    let windows = _.get(gataCartViewWindow, points)
    for (const index of _.range(windows.min, windows.max, 1)) {
        galaGoogleData[points].push([index*10])
        let last = galaGoogleData[points].length - 1
        series.forEach((serie, i) => {
            galaGoogleData[points][last].push(serie.data[index])
        })
    }
})


